■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>低分子コラーゲン5800mg配合!!飲みやすいドリンクタイプ。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5438/1078454-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>1日30～50mlを目安にお召し上がりください。<br><br>【ご注意】<br>●開封後はキャップで手を切らないようにお気をつけください。<br>●乳幼児の手の届かないところに保存してください。<br>●開封後は冷蔵庫で保存し、お早めにお召し上がりください。<br>●お身体に合わない場合は飲む量を控えるか、飲用を中止してください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">コラーゲンにプラセンタやセラミドを質や量にこだわり配合しました。また、ビタミンCやビタミンB1、ビタミンB2、ビタミンB6も同時に補える新しい美容飲料です。おいしいアップル味♪</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【100mlあたり】<br>エネルギー:104kcal、たんぱく質:12.5g、脂質:0g、炭水化物:13.5g、ナトリウム:24.8mg、ビタミンB1:1.2mg、ビタミンB2:2.3mg、ビタミンB6:11mg、ビタミンC:1600mg<br>コラーゲンペプチド:11600mg、セラミド:1600μg、プラセンタ粉末:330mg、トレハロース:1600mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">名称：清涼飲料水<br>果糖ぶどう糖液糖、コラーゲン、リンゴ果汁、トレハロース、ビタミンC、プラセンタ、酸味料(クエン酸)、香料、保存料(安息香酸Na)、カラメル色素、ベリー色素、セラミド、ビタミンB6、ビタミンB1、ビタミンB2</font></td></tr></table><b