■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><img src="http://image.rakuten.co.jp/manpura/cabinet/60000-/0217205-01.jpg" width="600" height="769"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/60000-/0217205-02.jpg" width="600" height="959"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/60000-/0217205-03.jpg" width="600" height="811"><br><img src="http://image.rakuten.co.jp/manpura/cabinet/60000-/0217205-04.jpg" width="600" height="388"></td></tr></table><br><table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><h1><font color="#333333" size="3">外出・就寝時など足裏が冷えるときに重宝します。足裏に着用して、輻射熱により足裏を温めることができます。伸縮性・弾力性に優れており、薄手なので靴を履いても使用できます。底面にクッションが入っているので、土踏まず部分にぴったりフィットします。</font></h1></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">外出・就寝時など足裏が冷えるときに重宝します。足裏に着用して、輻射熱により足裏を温めることができます。伸縮性・弾力性に優れており、薄手なので靴を履いても使用できます。底面にクッションが入っているので、土踏まず部分にぴったりフィットします。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">約10&times;6.5cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約35g、個装：約50g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ベルト：ナイロン（チタンコーティング）、SBRゴム（スチレンブタジエンゴム）<br>クッション：TPE</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font><