■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>グルコサミンとコンドロイチンを配合したホットジェル!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5355/1033630-01.jpg" width="184" height="463"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【ご使用方法】<br>1日数回ジェルをお肌に直接塗り、もみながら塗りこんで下さい。<br><br>【保存方法】<br>乳幼児の手の届かない所に保管して下さい。<br>高温多湿及び直射日光を避け、湿気の少ない涼しい場所に密栓して保管して下さい。<br><br>【発売元】<br>株式会社京都栄養化学研究所<br>京都府相楽郡精華町大字下狛小字西川原78</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">サプリメントでおなじみのグルコサミン・コンドロイチンを直接、膝(ヒザ)・肘(ヒジ)・腰(コシ)に塗布することができます。お肌にもみこむように塗りこむと、温感が得られるホットジェルです。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">サプリメントでおなじみのグルコサミン・コンドロイチンを直接、膝(ヒザ)・肘(ヒジ)・腰(コシ)に塗布することができます。お肌にもみこむように塗りこむと、温感が得られるホットジェルです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">120g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：6×4×16cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：135g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">水、エタノール、PPG-6デシルテトラデセス-30、ジメチルスルホン(MSM)、カルボマー、キサンタンガム、水酸化K、アセチルグルコサミン、コンドロイチン硫酸Na、グリチルリチン酸2K、プラセンタエキス、マロニエエキス、ヨクイニンエキス、メントール、サリチル酸メチル、メチルパラベン、エチルパラベン、香料、BG</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">使用期限:製造から1080日(未開封)</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
